Dashmix.onLoad(
  class {
    static initOnboardingModal() {
      let i = document.getElementById("modal-onboarding");
      new bootstrap.Modal(i).show(),
        i.addEventListener("shown.bs.modal", (i) => {
          document
            .querySelector("#modal-onboarding .js-slider")
            .classList.remove("js-slider-enabled"),
            Dashmix.helpers("jq-slick");
        });
    }
    static init() {
      this.initOnboardingModal();
    }
  }.init()
);
